import Mask from "../assets/mask.png";
import Steth from "../assets/stethscope.png";
import Medicine from "../assets/medicine.png";

export const CardDetails = [
  { id: 1, title: "N95 Mask", img: Mask },
  { id: 2, title: "Medical Equipment", img: Steth },
  { id: 3, title: "Medicines", img: Medicine },
  { id: 4, title: "N95 Mask", img: Mask },
  { id: 5, title: "Medical Equipment", img: Steth },
  { id: 6, title: "Medicines", img: Medicine },
  { id: 7, title: "N95 Mask", img: Mask },
  { id: 8, title: "Medical Equipment", img: Steth },
  { id: 9, title: "Medicines", img: Medicine },
  { id: 10, title: "Medical Equipment", img: Steth },
];
